import React from "react";
import "./style.css";

function Footer() {
  return (
    <footer className="footer">
      <button className="btn1">Contact</button>
      <span>Stay Healthy</span>
      <button className="btn2">rename this button</button>
    </footer>
  );
}

export default Footer;
